--------------------------------------------------------
--  DDL for View VIEW_IOLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "VIEW_IOLIST" ("IO_SEQ", "IO_DATE", "IO_INOUT", "IO_DCODE", "IO_NAME", "IO_DCEO", "IO_DTEL", "IO_DADDR", "IO_PCODE", "IO_PNAME", "IO_IPRICE", "IO_OPRICE", "IO_PVAT", "IO_QTY", "IO_PRICE", "IO_TOTAL") AS 
  (
SELECT
    IO.IO_SEQ,
    IO.IO_DATE,
    IO.IO_INOUT,
    IO.IO_DCODE,
  
    D.D_NAME AS IO_NAME,
    D.D_CEO AS IO_DCEO,
    D.D_TEL AS IO_DTEL,
    D.D_ADDR AS IO_DADDR,
    
    IO.IO_PCODE,
         
    P.P_NAME AS IO_PNAME,
    P.P_IPRICE AS IO_IPRICE,
    P.P_OPRICE AS IO_OPRICE,
    P.P_VAT AS IO_PVAT,
    

    IO.IO_QTY,
    IO.IO_PRICE,
    IO.IO_TOTAL
    
FROM tbl_iolist IO
   LEFT JOIN tbl_product P
        ON IO.io_pcode = P.p_code
    LEFT JOIN tbl_dept D
        ON IO.io_dcode = D.d_code
 
)
;
REM INSERTING into VIEW_IOLIST
SET DEFINE OFF;
